import React from 'react'

export default function addMenu() {
  return (
    <div>
      <div class="container mt-5">
        <h2>Dish Information</h2>
        <form>
            {/* <!-- Dish Name Input --> */}
            <div class="form-group">
                <label for="dishName">Dish Name:</label>
                <input type="text" class="form-control" id="dishName" placeholder="Enter the name of the dish"/>
            </div>

            {/* <!-- Image URL Input --> */}
            <div class="form-group">
                <label for="imageUrl">Image URL:</label>
                <input type="text" class="form-control" id="imageUrl" placeholder="Enter the image URL"/>
            </div>

            {/* <!-- Description Input --> */}
            {/* <div class="form-group">
                <label for="description">Description:</label>
                <textarea class="form-control" id="description" rows="4" placeholder="Enter a description"></textarea>
            </div> */}

            {/* <!-- Price Input --> */}
            {/* <div class="form-group">
                <label for="price">Price:</label>
                <input type="number" class="form-control" id="price" placeholder="Enter the price"/>
            </div> */}

            {/* <!-- Submit Button --> */}
            <button type="submit" class="btn btn-primary">Submit</button>
        </form>
    </div>
    </div>
  )
}
